import React from 'react';
import Navbar from './Navbar';
import Footer from './Footer';
import PhotoGallery from './PhotoGallery';

const PageLayout = ({ children }) => {
  return (
    <>
      <Navbar />
      <div className="page-content">{children}</div>
      <PhotoGallery />
      <Footer />
    </>
  );
};

export default PageLayout;
